To determine the number of sides of a convex polygon given the sum of all its exterior angles except one is \(1070^\circ\), we start by recalling a fundamental property of polygons: the sum of the exterior angles of any polygon is always \(360^\circ\).

Let \(n\) be the number of sides of the polygon. Then, the sum of all the exterior angles is \(360^\circ\). If we know the sum of all the exterior angles except one is \(1070^\circ\), we can express this relationship as:

\[360^\circ - \text{one exterior angle} = 1070^\circ \text{ (if we consider the exterior angle we subtract as the negative of its actual value)}\]

