\[
\frac{137}{500} = \frac{137 \div 1}{500 \div 25} = \frac{137}{20} \times \frac{1}{100} = \frac{137 \div 20}{100} = 0.685
\]

Next, we perform the division \(137 \div 4\) to confirm the decimal expansion:
\[
137 \div 4 = 34.25
\]
Thus,
\[
\frac{137}{500} = 0.274
\]

