Правоаголникот $ABCD$ има центар $O$ и $AB/AD=k$. Точка е случајно избрана од внатрешноста на правоаголникот $ABCD$. Која е веројатноста дека таа е поблиску до $O$ отколку до било кој од четирите темиња?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

